import {gql} from "apollo-boost";

export const CountryQuery = gql`
    query country($name: String!) {
        country(name: $name) {
          name
          native
          phone
          continent{
                code
                name
            }
          capital
          currency
          languages{
            code
            name
          }
          emoji
           
        }
    }
`;
